import React, { useEffect, useState } from "react";
import axios from "axios";

function App1() {
  const [response, setResponse] = useState();

  useEffect(() => {
    const options = {
      method: 'GET',
  url: 'https://brianiswu-open-brewery-db-v1.p.rapidapi.com/breweries/search',
  params: {query: 'dog'},
  headers: {
    'X-RapidAPI-Key': 'e8e6d1cb20msh3c038ddf785e626p1a61ccjsn3f1d9d72ccb6',
    'X-RapidAPI-Host': 'brianiswu-open-brewery-db-v1.p.rapidapi.com'
      }
    };

    axios.get('https://brianiswu-open-brewery-db-v1.p.rapidapi.com/breweries/search', options)
      .then(response => {
        setResponse(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div className="app">
      {response &&
        <div className="item-container">
          Answer: {response.website_url}
        </div>
      }
    </div>
  );
}

export default App1;
